import React from "react";
import Navbar from "../../../src/components/Navbar/Navbar";
import Header from "../Header/Header";
import Footer from "../Footer/Footer";
import "./App.css";

const App = () => {
  console.log("test");
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<App />}>
            <Route path="navbar" element={<Navbar />} />
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
};
export default App;
